import "./Filter.css";

const Nav = () => {

  return(<div>
    <ul className="nav"><li><a href="/">Home</a></li><li><a href="/battle" aria-current="page">Battle</a></li><li><a href="/popular">Popular</a></li></ul>

  </div>);
};

export default Nav;
